import 'react-native-gesture-handler';
import React, { useEffect, useState } from 'react'
import { NavigationContainer } from '@react-navigation/native'
import { Image, Text, TextInput, TouchableOpacity, View } from 'react-native'
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { WelcomeScreen, LoginScreen, HomeScreen, ProfileScreen,
RegistrationScreen, SearchScreen, BottomScreen, SymptomsScreen,
AddSymptomScreen } from './src/screens'
import { AppLoading } from 'expo';
import { useFonts, Roboto_100Thin, Roboto_300Light, Roboto_400Regular, Roboto_500Medium, Roboto_700Bold } from '@expo-google-fonts/roboto';
import {decode, encode} from 'base-64'
import { firebase } from './src/firebase/config'
if (!global.btoa) {  global.btoa = encode }
if (!global.atob) { global.atob = decode }


const Tab = createBottomTabNavigator();

function BottomTabs({ route }) {
  const { user } = route.params;
	return (    
		<Tab.Navigator>
    { user ? (
      <>
			<Tab.Screen name="Home"
      options={{
            title: '',
            tabBarIcon: ({size,focused,color}) => {
              return (
                <Image
                  style={{ width: size, height: size, alignItems: 'center',	flexDirection: 'row',	justifyContent: 'center' }}
                  source={{
                    uri:
                      'data:image/png;base64,',
                  }}
                />
              );
            },
          }} >
      {props=> <HomeScreen  {...props} extraData={user}/> }      
      </Tab.Screen>
      <Tab.Screen name="Search"
      options={{
            title: '',
            tabBarIcon: ({size,focused,color}) => {
              return (
                <Image
                  style={{ width: size, height: size, alignItems: 'center',	flexDirection: 'row',	justifyContent: 'center' }}
                  source={{
                    uri:
                      'data:image/png;base64,',
                  }}
                />
              );
            },
          }} >
      {props=> <SearchScreen  {...props} extraData={user} /> }      
      </Tab.Screen>
      <Tab.Screen name="Symptoms"
      options={{
            title: '',
            tabBarIcon: ({size,focused,color}) => {
              return (
                <Image
                  style={{ width: size, height: size, alignItems: 'center',	flexDirection: 'row',	justifyContent: 'center' }}
                  source={{
                    uri:
                      'data:image/png;base64,',
                  }}
                />
              );
            },
          }} >
      {props=> <SymptomsScreen  {...props} extraData={user} /> }      
      </Tab.Screen>
       <Tab.Screen name="Profile"
      options={{
            title: '',
            tabBarIcon: ({size,focused,color}) => {
              return (
                <Image
                  style={{ width: size, height: size, alignItems: 'center',	flexDirection: 'row',	justifyContent: 'center' }}
                  source={{
                    uri:
                      'data:image/png;base64,',
                  }}
                />
              );
            },
          }} >
      {props=> <ProfileScreen  {...props} extraData={user} /> }      
      </Tab.Screen>  

      </>
      ):(<></>)}
		</Tab.Navigator>
    
	);
}

const Stack = createStackNavigator();

export default function App() {
  
  const [loading, setLoading] = useState(true)
  const [user, setUser] = useState(null)

    useEffect(() => {
    const usersRef = firebase.firestore().collection('users');
    firebase.auth().onAuthStateChanged(user => {
      if (user) {
        usersRef
          .doc(user.uid)
          .get()
          .then((document) => {
            const userData = document.data()
            setLoading(false)
            setUser(userData)
          })
          .catch((error) => {
            setLoading(false)
          });
      } else {
        setLoading(false)
      }
    });
  }, []);



 
  const [fontsLoaded] = useFonts({
	RobotoT: Roboto_100Thin,
	RobotoL: Roboto_300Light,
	RobotoR: Roboto_400Regular,
	RobotoM: Roboto_500Medium,
	RobotoB: Roboto_700Bold,
  });

  if (!fontsLoaded) {
	return <AppLoading />;
  }

	return (
		<NavigationContainer>
    { user ? (
			<Stack.Navigator initialRouteName="Tabs">
      	<Stack.Screen name="Symptogram" component={BottomTabs} initialParams={{ user:user }}/>
			</Stack.Navigator>):
      (<>
      <Stack.Navigator>
            <Stack.Screen options={{headerTransparent: true, headerTitle: false, headerBackTitle: false}} name="Welcome" component={WelcomeScreen} />
            <Stack.Screen options={{headerTransparent: true, headerTitle: false, headerBackTitle: false}} name="Registration" component={RegistrationScreen} />
            <Stack.Screen options={{headerTransparent: true, headerTitle: false, headerBackTitle: false}} name="Login" component={LoginScreen} />
            <Stack.Screen options={{headerTransparent: true, headerTitle: false, headerBackTitle: false}} name="Search" component={SearchScreen} />            
            <Stack.Screen options={{headerTransparent: true, headerTitle: false, headerBackTitle: false}} name="Symptoms" component={SymptomsScreen} />            
            <Stack.Screen options={{headerTransparent: true, headerTitle: false, headerBackTitle: false}} name="Profile" component={ProfileScreen} />            
            <Stack.Screen options={{headerTransparent: true, headerTitle: false, headerBackTitle: false}} name="AddSymptom" component={AddSymptomScreen} />            
      </Stack.Navigator>
      </>
      )
      }
		</NavigationContainer>
	);
}
